import React from "react";
import PostsCatalog from "../components/PostsCatalog";

const DUMMY_POSTS = [
  {
    id: "p1",
    imagaUrl:
      "https://www.google.com/url?sa=i&url=https%3A%2F%2Ftanglesandtravels.com%2F2016%2F08%2F06%2Fsunset-in-calatagan-batangas%2F&psig=AOvVaw2O4N-gfGvU1Ghcz24n6CB-&ust=1596961878109000&source=images&cd=vfe&ved=0CAIQjRxqFwoTCNjFr96Yi-sCFQAAAAAdAAAAABAT",
    location: "Binubusan, Lian, Batangas",
    description:
      "Ang magandang kabundukin at karagatan dito sa Matuod, Binubusan.",
    coordinates: {
      lat: 13.9783756,
      lng: 120.62508,
    },
    creator: "u1",
  },
  {
    id: "p2",
    imagaUrl:
      "https://www.google.com/url?sa=i&url=https%3A%2F%2Fwww.facebook.com%2Fmatuodbeachph%2F&psig=AOvVaw2O4N-gfGvU1Ghcz24n6CB-&ust=1596961878109000&source=images&cd=vfe&ved=0CAIQjRxqFwoTCNii8OiYi-sCFQAAAAAdAAAAABAG",
    location: "Binubusan, Lian, Batangas",
    description:
      "Ang magandang kabundukin at karagatan dito sa Matuod, Binubusan.",
    coordinates: {
      lat: 13.9783756,
      lng: 120.62508,
    },
    creator: "u2",
  },
];

const UserPosts = (props) => {
  return <PostsCatalog bits={DUMMY_POSTS} />;
};

export default UserPosts;
